column8:
体重体組成計 カラダスキャン HBF-214<br>
<br>
収納に便利なスリムデザイン。<br>
<br>
充実機能＆ガラス仕様<br>
<hr>
◎狭いすき間にも収納できる、厚さ28cmの薄型設計<br>
<br>
・厚さは28mmと、狭いスペースにも収納できるスリムサイズ。<br>
・4隅には滑り止めゴムがついているので、床を傷つけることなく、安全に収納することができます。<br>
・また、裏面はくぼみのある持ちやすい形状なので、楽に取り出しや片づけができます。<br>
<br>

◎お手入れ簡単なガラス天板のフラットデザイン<br>
<br>
・ガラス天板のフラットデザインなので、埃がたまりにくく、お手入れも簡単。毎日気持ちよく使えます。<br>
<br>
◎測定結果が見やすい、大きな文字表示<br>
<br>
・オムロン最大の文字サイズなので、立ったままでも測定結果をしっかり確認できます。<br>
<hr>
【本体質量】約1.6kg（電池含む）<br>
<br>
【外形寸法】幅約285×高さ約28×奥行き約280mm<br>
<br>
【電源】単4形マンガン乾電池（R03）×4　※単4形アルカリ乾電池（LR03）×4でも可能<br>
<br>
【付属品】お試し用電池（単4形マンガン乾電池×4本）、取扱説明書（品質保証書付き）<br>
<hr>
≪機能について≫<br><br>
■厚さ28mmの薄型設計<br>
■お手入れ簡単なガラス天板のフラットデザイン<br>
■立ったままでも測定結果を確認できる、大きな文字表示<br>
■両足測定<br>
<hr>
登録人数：4人分<br>
<br>
体脂肪率：体脂肪率（0.1%単位）／体脂肪率判定（4段階）<br>
<br>
骨格筋率：骨格筋率（0.1%単位）／骨格筋率判定（4段階）<br>
<br>
内臓脂肪：内臓脂肪レベル（1～30）／内臓脂肪レベル判定（3段階）<br>
<br>
体年齢：体年齢表示（1才単位）<br>
<br>
ポイントメモリ：前回値表示<br>
<br>
BMI：BMI表示<br>
<br>
基礎代謝：基礎代謝表示<br>
<hr>
【お問い合わせ先】<br>
オムロンヘルスケア株式会社<br>
お客様サービスセンター<br>
TEL 0120-30-6606<br>
受付時間　土・日・祝日・年末年始を除く午前9時から午後7時まで<br>
<br>
オムロンヘルスケア株式会社<br>
〒615-0084　京都市右京区山ノ内山ノ下町24番地<br>
