・測定値を90回分メモリー <br> 
・測定中の体動を体動マークでお知らせ <br> 
・測定中の脈間隔の変動を脈間隔変動マークでお知らせ<br>  
・測定値の最新3回分の平均値を表示 <br> 
・巻きやすいソフトカフを採用 <br> 
・モニター用アルカリ電池（4本）付属 <br> <br> 

○測定値を90回分メモリー<br>  
最高血圧値、最低血圧値、脈拍数を90回分メモリーします。<br> <br> 



○平均値の表示（最新3回平均）<br>  
メモリーボタンを押すと最新3回分までの平均値を表示します。<br> 
最近のご自身の平均値と比べて、血圧値の変化がわかりやすいです。<br> <br> 



○測定中の体動をマークでお知らせ<br>  
測定中に手や手首などが動き、大きな圧力変化を検出した場合、測定終了後に「体動マーク」でお知らせします。<br> 
体動マークが点灯した場合は、再測定をお勧めします。<br> <br> 




○不規則な脈間隔をマークでお知らせ <br> 
測定中の脈の間隔が不規則な場合、測定終了後に「脈間隔変動マーク」でお知らせします。<br> 
脈間隔変動マークが点灯した場合は、再測定をお勧めします。<br> <br> 

※「脈間隔変動マーク」が頻繁に表示される場合は、ご自身の健康状態について医師に相談してください。<br> <br> 

【サイズ】<br>  
約130（幅）×53（高さ）×118（奥行き）mm <br><br>  
【質量】<br>
本体　約240g（電池含まず）、カフ　約130g <br><br>  


【付属品】<br>
ソフトカフ、取扱説明書（保証書付き）、モニター用単3形電池4本 <br><br>  
【仕様】<br> 
測定方式／オシロメトリック法 <br> 
測定部位／左腕（右上腕も可）<br>  
カフ（適用腕周範囲）／ソフトカフ（範囲：約22～32cm）<br>  
表示方式／デジタル表示 <br> 
測定範囲／圧力0～280mmHg、目量1mmHg、脈拍40～180拍/分 <br> 
測定精度／圧力　±3mmHg、脈拍数±5％以内 <br> 
加圧／ポンプによる自動加圧 <br> 
減圧／微速排気弁方式 <br> 
排気／電磁弁による自動排気 <br> 
定格及び電源／DC6V、単3形乾電池×4本 <br> 
電池寿命／アルカリ乾電池　約1000回、マンガン乾電池　約300回<br> 
メモリー／90回分 <br> <br>


医療機器認証番号／221ADBZX00065000 (管理医療機器)<br><br>


シチズン・システムズ（株）　<br>
